import React, { Component } from "react";
import Boy from "./Boy";

class Content extends Component {
    render() {
        if(this.props.first){
            return (
                <div id="content">
                    <Boy/>
                </div> 
            );
        }
        else{
            return (
                <div id="content">
                </div> 
            );
        }
    }
}

export default Content;
